import React from 'react';

function Card(key,id,title,desc,price) {//in jsx instead of class we need to use className and instead of style="" we need to provide and object like style={{width:18}} something like that. Remeber to use camel casing for react
    const cardStyle = {
        width: '18rem'
    };

    return (
        <div className="card" id={`card-${id}`} style={cardStyle}>
            <svg className="bd-placeholder-img card-img-top" width="100%" height="180" xmlns="http://www.w3.org/2000/svg" role="img" aria-label="Placeholder: Image cap" preserveAspectRatio="xMidYMid slice" focusable="false">
                <title>Placeholder</title>
                <rect width="100%" height="100%" fill="#868e96"></rect>
                <text x="50%" y="50%" fill="#dee2e6" dy=".3em">{id}</text>
            </svg>
            <div className="card-body">
                <h5 className="card-title">{title}</h5>
                <p className="card-text">{desc}</p>
                <a href={`/page?itemid=${id}`} className="btn btn-primary">{price}</a>
            </div>
        </div>
    );
}

export default Card;
